            "description_short": [
                {
                    "id": "1",
                    "value": "<p>Parce que nous croyons en la beauté naturelle, Maison d'Asa vous propose un magnifique coffret de 3 produits phares de notre terroir pour une routine visage et cheveux naturelle qui explore les bienfaits de l'eau de rose et de l'huile d'argan et qui comprend :</p>\n<p>- O de Rose, notre eau de rose Bio aux vertus hydratantes et apaisantes directement sourcées de la vallée de Kelâat M'gouna</p>\n<p>- Elixir d'Argan, une huile d'argan 100% Bio et vierge extraite à froid dont la richesse en vitamine E en fait le parfait elixir anti-age.</p>\n<p>- Le Sérum Capillaire à l'huile d'Argan Bio, à utiliser en masque ou simplement sur les pointes pour hydrater le cuir chevelu et lui rendre sa beauté et sa douceur naturelle.</p>"
                },
                {
                    "id": "11",
                    "value": "<p>Because we believe in natural beauty, Maison d'Asa offers you a magnificent set of 3 flagship products from our terroir for a natural face and hair routine that explores the benefits of rose water and argan oil and includes :</p>\n<p>- O de Rose, our organic rose water with moisturizing and soothing virtues directly sourced from the Kelâat M'gouna valley.</p>\n<p>- Elixir d'Argan, a 100% organic and virgin cold extracted argan oil whose richness in vitamin E makes it the perfect anti-aging elixir.</p>\n<p>- Organic Argan Hair Serum to be used as a mask or simply on the tips to moisturize the scalp and restore its beauty and natural softness.</p>\n<p></p>\n<p></p>"
                }
            ],
