                    "value": "<p>Parce que le bien-être commence chez soi, Maison d'Asa a crée pour vous un coffret spécial pour apaiser l'esprit grâce à la combinaison de 2 produits :</p>\n<p>- Notre diffuseur à tiges Bois d'Orient qui saura habiller noblement vos intérieurs avec ses notes boisées de santal et de cèdre adoucie par une touche de patchouli</p>\n<p>- Notre brume d'oreiller Caresse de Coton, composée de 12 huiles essentielles aux propriétés relaxantes dont une pulvérisation sur votre oreiller avant de vous coucher saura bercer votre esprit avec ses douces senteurs irisées.</p>"
