            "description": [
                {
                    "id": "1",
                    "value": "<p class=\"MsoNormal\" style=\"margin:0cm 0cm .0001pt;font-size:12pt;font-family:'Times New Roman', serif;\"><span style=\"font-family:Optima;\">Infusion d’Atlas est une eau de parfum pensée au Maroc et fabriquée auprès des plus grands maitres parfumeurs de Grasse. À travers cette fragrance, Maison d’Asa fait revivre sur votre peau la fraîcheur douces des montagnes de l’Atlas et de ses arbres fruitiers en mêlant de délicates notes d’iris, de mandarine, de pamplemousse et de citron</span></p>\n<p></p>"
                },
                {
                    "id": "11",
                    "value": "<p class=\"MsoNormal\" style=\"margin:0cm 0cm .0001pt;font-size:12pt;font-family:'Times New Roman', serif;\"><span lang=\"en-us\" style=\"font-family:Optima;\" xml:lang=\"en-us\">Infusion d'Atlas is an eau de parfum designed in Morocco and made by the greatest master perfumers of Grasse. Through this fragrance, Maison d'Asa brings the soft freshness of the Atlas Mountains and its fruit trees to your skin by blending very soft notes of iris, tangerine, grapefruit and lemon.</span></p><p></p>\n<p></p>"
                }
            ],
